import React from 'react';

import circlePlaceholder from './Icons/circlePlaceholder.png';
import FlipCard from './Components/FlipCard.js'

const ThirdPage = () => (
    /*
CI/CD & Build Tools: Jenkins
    */


  <div className='third-page' id='third-page'>


    <div className='flip-cards-div'>
      <FlipCard
        imageSrc={circlePlaceholder}
        title="Programming Languages"
        bulletPoints={[
            "JavaScript",
            "C#",
            "Java",
            "TypeScript"
        ]}
      />

    <FlipCard
        imageSrc={circlePlaceholder}
        title="Web Technologies"
        bulletPoints={[
            "HTML",
            "CSS",
            "React",
            "Knockout",
            "RequireJS",
            "Oracle Jet"
        ]}
      />


    <FlipCard
        imageSrc={circlePlaceholder}
        title="Game & XR Development"
        bulletPoints={[
            "Unity",
            "MRTK",
            "StereoKit"
        ]}
      />

    </div>


    <FlipCard
        imageSrc={circlePlaceholder}
        title="Testing & Automation"
        bulletPoints={[
            "QUnit", 
            "Selenium", 
            "PowerMockito", 
            "Karma", 
            "Mocha"
        ]}
      />

    </div>


);

export default ThirdPage;
